import './card.css';

const Card = () => (

    <div className="card">
        <img scr="https://i.imgur.com/aadwyfC.jpg" alt="Imagem Ilustrativa" className="card-image"/>
        <div className>
            <p className="card-subject">Algoritmos e Programção</p>
            <h1 className="card-task">Enviar arquivos Peter Smokes</h1>
            <p className="card-deadline">10/10/21</p>
        </div>
    </div>

);

export default Card;
